import Link from "next/link";
import AppLayout from "../components/AppLayout";
import Head from "next/head";


const Home = () => {
  return (
    <>
      <Head>
        <title>NodeBird</title>
      </Head>
      <AppLayout>
        <Link href="/about">
          <a>about</a>
        </Link>
        <div>hello,next!</div>
        {/* AppLayout내에 태그내에 있는 내용 전체를 {children} 으로 받을 수 있는 것 */}
      </AppLayout>
    </>
  );
};
export default Home;
